-- TOC entry 321 (class 1255 OID 27886)
-- Name: md_add_relation_attribute(integer, character varying, character varying, boolean, character varying, character varying, character varying); Type: FUNCTION; Schema: kloopzcm; Owner: kloopzcm
--

CREATE FUNCTION md_add_relation_attribute(p_rel_id integer, p_attribute_name character varying, p_data_type character varying, p_is_mandatory boolean, p_default_value character varying, p_value_format character varying, p_descr character varying, OUT out_attribute_id integer) RETURNS integer
